import { useState } from "react";
import "./form.scss"
import { TextField } from "@mui/material";

const Form = () => {
  const [data, setData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    birthDate: Date.now(),
    city: "",
    zip: "",
  });

  return (
    <form className="form">
        <TextField 
            id="outlined-basic"
            label="Nom" 
            variant="outlined"
            onChange={(event) =>
                setData({ ...data, lastName: event.target.value })}
            />
        <TextField 
            id="outlined-basic"
            label="PrÃ©nom" 
            variant="outlined"
            onChange={(event) =>
                setData({ ...data, firstName: event.target.value })}
            />
        <TextField 
            id="outlined-basic"
            label="Email" 
            variant="outlined"
            onChange={(event) =>
                setData({ ...data, email: event.target.value })}
            />
        <TextField 
            id="outlined-basic"
            label="Date de naissance" 
            variant="outlined"
            onChange={(event) =>
                setData({ ...data, birthDate: event.target.value })}
            />
        <TextField 
            id="outlined-basic"
            label="Nom" 
            variant="outlined"
            onChange={(event) =>
                setData({ ...data, lastName: event.target.value })}
            />
        <TextField 
            id="outlined-basic"
            label="Nom" 
            variant="outlined"
            onChange={(event) =>
                setData({ ...data, lastName: event.target.value })}
            />
      
    </form>
  );
};

export default Form;
